(7, 'Kamino Cloning Facilitie', 'Kamino Cloning Facilities is a joint venture between Kamino Medical Laboratories, and the native geneticists of Kamino. We sell Phase V Clone Troopers, as well as bespoke equipment provided by Holowan Mechanicals.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1333/'),
(53, 'Ordnance and Supply', 'We handle the sales of all medical equipment for Ordnance and Supply.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1333/'),
