(157, 'Resistance O&S', 'Our Galactic Bazaar shop has temporarily relocated to the Swap Meet! We stock a wide range of products sure to appeal to every requirement.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1333/'),
(170, 'Blue Star Arms (Issor)', 'High-quality tactical gear from Blue Star Dominion.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1597/'),
