(658, 'DMC Champala Vendor', 'Weapons/Armour Sales! \nEnjoy your shopping experience. If you feel you really need to barter on a larger quantity purchase, message Metyl and he might change the prices remotely. \nThere is an RM vendor at the Depot IV. Bounty Hunting taverns on Chag II.', 'https://www.swcombine.com/ws/v2.0/character/1%3A1227254/'),
