(10, 'Nimban Outpost', 'Resistance Ordnance and Supply sells a wide variety of military surplus goods from it\'s base in the Arkanis sector. The Nimban outpost primarily deals in medical supplies.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1333/'),
(175, 'Angry Rancor\'s Drugs & Booze', 'I got the Ryll custom recreational products you need. Get them before I get busted for being here.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1257/'),
(324, 'Adi\'s Droid Shop', 'Selling a variety of new and preowned droids.', 'https://www.swcombine.com/ws/v2.0/character/1%3A34079/'),
(478, 'Mecrotica Trade Lorell Trade Centre', 'If you don\'t see what you are looking for, or need anything at all, contact my Boss, Dac Kain he will help you out.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1257/'),
(509, 'Hiwatta Discount', 'All kinds of item\'s  , at a discounted price Hiwatta Draav at your service. Looking for Raw materials or a brandy , mmm or you fancy more those green healing milk , then you might like a commando droid perhaps?', 'https://www.swcombine.com/ws/v2.0/character/1%3A1471393/'),
